CREATE DEFINER=`root`@`localhost` PROCEDURE `GenerateIncomeMonthlyReport`(in start_date DATE, in end_date DATE)
begin
-- Create a list of months for a given year
with recursive months as (
select
	1 as month
union all
select
	month + 1
from
	months
where
	month < 12
),
-- Aggregate data from your table
data as (
select
	year(web_gereja_2.incomes.income_date) as year,
	month(web_gereja_2.incomes.income_date) as month,
	COUNT(*) as total_entries,
	SUM(web_gereja_2.incomes.nominal) as total_income
from
	web_gereja_2.incomes
where
	web_gereja_2.incomes.income_date between start_date and end_date
group by
	year(web_gereja_2.incomes.income_date),
	month(web_gereja_2.incomes.income_date)
)
-- Final SELECT to combine months and data
select
	YEAR(start_date) as report_year,
	-- Set your report year
  case
		m.month
    when 1 then 'Januari'
		when 2 then 'Februari'
		when 3 then 'Maret'
		when 4 then 'April'
		when 5 then 'Mei'
		when 6 then 'Juni'
		when 7 then 'Juli'
		when 8 then 'Agustus'
		when 9 then 'September'
		when 10 then 'Oktober'
		when 11 then 'November'
		when 12 then 'Desember'
	end as report_month,
	coalesce(d.total_entries, 0) as total_entries,
	coalesce(d.total_income, 0) as total_income
from
	months m
left join
  data d on
	m.month = d.month
order by
	m.month;
end ;;
